// GraphPage.js
import React from 'react';
import { Link } from 'react-router-dom';

function GraphPage({ selectedArticles }) {
    // Eventually, you will include your graph logic here
    // For now, it will just show the selected article IDs

    return (
        <div>
            <h1>Graph for Selected Articles</h1>
            <p>Selected Articles IDs: {selectedArticles.join(', ')}</p>
            {/* Graph component will go here */}
            <Link to="/">Back to selection</Link>
        </div>
    );
}

export default GraphPage;
